import React from "react";

const RecipeDetail = ({ recipe }) => (
	<div>
		<h1>{recipe.label}</h1>
		<img
			src={recipe.image}
			alt={recipe.label}
		/>
		<ul>
			{recipe.ingredientLines.map((ingredient, index) => (
				<li key={index}>{ingredient}</li>
			))}
		</ul>
	</div>
);

export default RecipeDetail;
